    <div className="w-full bg-black min-h-footer text-center text-white align-middle leading-10">
      <span>
        made with <FaHeart className="inline" /> by Jack!
      </span>
      <br />
      <span>
        <FaEnvelope className="inline mr-2" />
        <a href="mailto:contact@010221.org" className="hover:text-red-200">
          contact@010221.org
        </a>
      </span>
    </div>
  );
}

export default Footer;
